import React from "react";

import { Modal, Form, InputNumber, Typography } from "antd";
const EditModal = ({ visible, data, onClose }) => {
  return (
    <Modal visible={visible} onCancel={onClose}>
      <Form
        hideRequiredMark
        initialValues={{
          id: data.id,
          table_number: data.table_number,
          seats: data.seats,
          date: data.date
        }}
      >
        <Form.Item name="id">
          <Typography level={4}> Edit Table items</Typography>
        </Form.Item>
        <Form.Item
          name="table_number"
          label="Tabel Number"
          rules={[{ required: true, message: "Enter table number" }]}
        >
          <InputNumber className="w-100" />
        </Form.Item>
        <Form.Item label="Seats" name="seats">
          <InputNumber className="w-100" />
        </Form.Item>
      </Form>
    </Modal>
  );
};

export default EditModal;
